require(['ojs/ojcore', 'knockout', 'jquery', 'ojs/ojknockout', 'ojs/ojmenu', 'ojs/ojtimeline'],
  function (oj, ko, $)
  {
    function ViewModel()
    {
      var self = this;

      self.seriesData = [{
          id: 'e1',
          title: 'ATP VTR Open',
          start: new Date('Feb 4, 2013').toISOString(),
          end: new Date('Feb 10, 2013').toISOString(),
          description: 'Finalist: 3-1'
        }, {
          id: 'e2',
          title: 'ATP Brasil Open',
          start: new Date('Feb 11, 2013').toISOString(),
          end: new Date('Feb 17, 2013').toISOString(),
          description: 'Champion: 4-0'
        }, {
          id: 'e3',
          title: 'ATP Abierto Mexicano Telcel',
          start: new Date('Feb 25, 2013').toISOString(),
          end: new Date('Mar 2, 2013').toISOString(),
          description: 'Champion: 5-0'
        }, {
          id: 'e4',
          title: 'ATP BNP Paribas Open',
          start: new Date('Mar 7, 2013').toISOString(),
          end: new Date('Mar 17, 2013').toISOString(),
          description: 'Champion: 6-0'
        }
      ];
      var items = ko.observableArray(self.seriesData)();
      self.timelineSeries = [{id: 's1', emptyText: 'No Data.', label:'Oracle Events', items: items}];

      self.selectedMenuItem = ko.observable('(None selected yet)');
      var itemTitle;
      self.beforeOpenFunction = function (event)
      {
        var target = event.detail.originalEvent.target;
        var context = document.getElementById('timeline').getContextByNode(target);
        if (context != null && context.subId == 'oj-timeline-item')
        {
          var itemIndex = context['itemIndex'];
          itemTitle = self.seriesData[itemIndex]['title'];
        }
      };
      self.menuItemAction = function (event)
      {
        var text = event.target.textContent;
        if (itemTitle)
        {
          self.selectedMenuItem(text + ' from ' + itemTitle);
          itemTitle = null;
        }
        else
          self.selectedMenuItem(text + ' from timeline background');
      };
    };

    $(
        function()
        {
            ko.applyBindings(new ViewModel(), document.getElementById('timeline-container'));
        }
    );
  }
);

require(['ojs/ojcore', 'knockout', 'jquery', 'ojs/ojknockout', 'ojs/ojpictochart', 'ojs/ojtoolbar', 'ojs/ojbutton', 'ojs/ojlegend', 'ojs/ojlabel'],
function (oj, ko, $) {
  function PictoChartModel() {
    var self = this;
    self.layoutOrigin = ko.observable("topStart");
    self.layout = ko.observable("horizontal");
    self.dataset = ko.observable("Population");
    self.header = ko.observable("2014 USA Population Age Brackets");
    var colorHandler = new oj.ColorAttributeGroupHandler();

    self.layoutOptions = ko.observable([
      {id: 'vertical', label: 'vertical', value: 'vertical'},
      {id: 'horizontal', label: 'horizontal', value: 'horizontal'}
    ]);
    self.layoutOriginOptions = ko.observable([
        {id: 'topStart', label: 'topStart', value: 'topStart'},
        {id: 'topEnd', label: 'topEnd', value: 'topEnd'},
        {id: 'bottomStart', label: 'bottomStart', value: 'bottomStart'},
        {id: 'bottomEnd', label: 'bottomEnd', value: 'bottomEnd'}
    ]);
    self.datasetOptions = ko.observable([
        {id: 'population', label: 'Population', value: 'Population'},
        {id: 'medals', label: 'Olympic Medals', value: 'Medals'}
    ]);
    var stats = {
     Population: [
      {name: '0-14 years', color: colorHandler.getValue('0-14'),shape: 'human', count: 19},
      {name: '15-24 years', color: colorHandler.getValue('15-24'),shape: 'human', count: 14},
      {name: '25-54 years', color: colorHandler.getValue('25-54'),shape: 'human', count: 40},
      {name: '55-64 years', color: colorHandler.getValue('55-64'),shape: 'human', count: 13},
      {name: '65+ years', color: colorHandler.getValue('65+'),shape: 'human', count: 14}
    ],
    Medals: [
      {name: 'Gold', shape: 'circle', rowSpan:4, columnSpan:4, color: "#ffd700", count: 46},
      {name: 'Silver', shape: 'circle', rowSpan:2, columnSpan:2,color: "#c0c0c0", count: 28},
      {name: 'Bronze', shape: 'circle', rowSpan:1, columnSpan:1,color: "#cd7f32", count: 29}
    ]};
    var legends = {
      Population: [{title: "Sizes", items: [
            {text: "1%", markerShape: "human"}
          ]},
          {title: "Ages",items: [
            {text: "0-14", color: colorHandler.getValue('0-14'), markerShape: "human"},
            {text: "15-24",color: colorHandler.getValue('15-24'), markerShape: "human"},
            {text: "25-54",color: colorHandler.getValue('25-54'), markerShape: "human"},
            {text: "55-64",color: colorHandler.getValue('55-64'), markerShape: "human"},
            {text: "65+",color: colorHandler.getValue('65+'), markerShape: "human"}
        ]}],
      Medals: [
          {title: "Medals",items: [
          {text: "Gold", color: "#ffd700", markerShape: "circle"},
          {text: "Silver", color: "#c0c0c0", markerShape: "circle"},
          {text: "Bronze",color: "#cd7f32", markerShape: "circle"},
        ]}]
    };
    var header = {
      Population: "2014 USA Population Age Brackets",
      Medals: "2012 USA Summer Olympics Medals"
    }

    self.pictoChartItems = ko.observableArray(stats[self.dataset()]);
    self.legendSections = ko.observableArray(legends[self.dataset()]);

    self.datasetChange = function (event) {
      var dataset = self.dataset();
      self.pictoChartItems(stats[dataset]);
      self.legendSections(legends[dataset]);
      self.header(header[dataset]);
    }
    self.tooltip = function (context) {
      var tooltipElem;
      if (self.dataset() == "Population") {
        tooltipElem = context.name+": "+context.count+"%";
      }
      else {
        tooltipElem = context.count+" "+context.name+" Medals";
      };
      return {'insert':tooltipElem};
    }
  }
  var pictoChartModel = new PictoChartModel();

  $(
    function() {
      ko.applyBindings(pictoChartModel, document.getElementById('chart-container'));
    }
  );
});
